import React from 'react'
import Cat from './Cat'
import Dog from './Dog'

// Check 
class Button extends React.Component{
    render(){
        if(this.props.check){
        return(
            <div>
                <Cat />
            </div>
        )
    } else {
        return(
            <div>
                <Dog />
            </div>
        )
    }
}

}

export default Button
